import React from 'react';
import './Navbar.css';

function Navbar() {
  return (
    <nav className="navbar">
      <h2 className="logo"><em>Seb's</em></h2>
      <ul className="menu">
        <li className="menu-item"><a href="/" className="menu-link active">Home</a></li>
        <li className="menu-item"><a href="/" className="menu-link">Booking</a></li>
        <li className="menu-item"><a href="/" className="menu-link">About Us</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
